            WriteLiteral(@"    <div class=""col-md-12"">
                                <div class=""main bg-white"">
                                    <h3 style=""text-align:center"">Privacy Policy</h3>
                                    <div class=""content"">
                                        <h3 class=""mb-2"">Collecting Personal Information</h3>
                                        <p>
                                            When you visit the Site, we collect certain information about your activity your interaction with the Site, and information necessary to process your purchases. We may also collect additional information if you contact us for customer support. In this Privacy Policy, we refer to any information that can uniquely identify an individual (including the information below) as “Personal Information”. See the list below for more information about what Personal Information we collect and why.
                                        </p>
                                        <h4 class=""mb-1"">Device Inf");
            WriteLiteral(@"ormation</h4>
                                        <ul>
                                            <li>

                                                <b class=""pivacypolicyLiH"">Examples of Personal Information collected:</b>
                                                <span class=""privacypolicyspan"">
                                                    version of web browser, IP address, time zone, cookie information, what pages you view, what functionalities you use, and how you interact with the Site.
                                                </span>
                                            </li>
                                            <li>

                                                <b class=""pivacypolicyLiH"">Purpose of collection:</b>
                                                <span class=""privacypolicyspan"">
