  ");
            WriteLiteral(@"                                              </span>
                                            </li>
                                            <li>

                                                <b class=""pivacypolicyLiH"">Source of collection:</b>
                                                <span class=""privacypolicyspan"">
                                                    Collected automatically when you access our Site using cookies, log files, web beacons, tags, or pixels.
                                                </span>
                                            </li>
                                            <li>

                                                <b class=""pivacypolicyLiH"">Disclosure for a business purpose: </b>
                                                <span class=""privacypolicyspan"">
                                                    we don’t share your information with any third-party companies. Also, we don’t store any of your data on any serve");
            WriteLiteral(@"r, as Reporting King is a web app and everything you do with your data remains locally on your machine.
                                                </span>
                                            </li>

                                        </ul>

                                        <h4 class=""mb-1"">Order Information</h4>
                                        <ul>
                                            <li>

                                                <b class=""pivacypolicyLiH"">Examples of Personal Information collected:</b>
                                                <span class=""privacypolicyspan"">
                                                    name, billing address, shipping address, payment information, email address.
                                                </span>
                                            </li>
                                            <li>

                                                <b class=""pivacypolicyLiH"">Purpose of");
            WriteLiteral(@" collection:</b>
                                                <span class=""privacypolicyspan"">
                                                    to provide products or services to you to fulfill our contract, to process your payment information, arrange for shipping, and provide you with invoices and/or order confirmations, communicate with you, screen our orders for potential risk or fraud, and when in line with the preferences you have shared with us, provide you with information or advertising relating to our products or services.
                                                </span>
                                            </li>
                                            <li>

                                                <b class=""pivacypolicyLiH"">Source of collection:</b>
                                                <span class=""privacypolicyspan"">
                                                    Collected from you.
                                                </span>
  ");
            WriteLiteral(@"                                          </li>


                                        </ul>

                                        <h4 class=""mb-1"">Customer support information</h4>
                                        <ul>
