                                                <b class=""pivacypolicyLiH"">Disclosure for a business purpose:</b>
                                                <span class=""privacypolicyspan"">
                                                    we don’t share your information with any third-p");
            WriteLiteral(@"arty companies.
                                                </span>
                                            </li>


                                        </ul>
                                        <h4 class=""mb-1"">Minors</h4>
                                        <p>
                                            The Site is not intended for individuals under the age of 16. We do not intentionally collect Personal Information from children. If you are the parent or guardian and believe your child has provided us with Personal Information, please contact us at the address below to request deletion.

                                        </p>
                                        <h3 class=""mb-1"">Using Personal Information</h3>
                                        <p>
                                            We use your personal Information to provide our services to you, which includes: offering products for sale, processing payments, shipping and fulfillment of your order, a");
            WriteLiteral(@"nd keeping you up to date on new products, services, and offers
                                        </p>
                                        <h4 class=""mb-1"">Lawful basis</h4>
                                        <p>
                                            Pursuant to the General Data Protection Regulation (“GDPR”), if you are a resident of the European Economic Area (“EEA”), we process your personal information under the following lawful bases:
                                        </p>
                                        <ul>
                                            <li class=""privacypolicyspan"">Your Consent</li>
                                            <li class=""privacypolicyspan"">The performance of the contract between you and the Site;</li>
