                                            <li class=""privacypolicyspan"">To protect your vital interests;</li>");
            WriteLiteral(@"
                                            <li class=""privacypolicyspan"">To perform a task carried out in the public interest;</li>
                                            <li class=""privacypolicyspan"">For our legitimate interests, which do not override your fundamental rights and freedoms.</li>
                                        </ul>
                                        <h4 class=""mb-1"">Retention</h4>
