                                            When you place an order through the Site, we will retain your Personal Information for our records unless and until you ask us to erase this information. For more information on your right of erasure, please see the ‘Your rights’ section below.
                                        </p>
                                        <h4 class=""mb-1"">Automatic decision-making</h4>
                                        <p>
                                            If you are a resident of the EEA, you ha");
            WriteLiteral(@"ve the right to object to processing based solely on automated decision-making (which includes profiling), when that decision-making has a legal effect on you or otherwise significantly affects you.
                                        </p>
                                        <p>
                                            We DO NOT engage in fully automated decision-making that has a legal or otherwise significant effect using customer data.
                                        </p>
                                        <p>
                                            Services that include elements of automated decision-making include:
                                        </p>
                                        <ul>
                                            <li class=""privacypolicyspan"">Temporary denylist of IP addresses associated with repeated failed transactions. This denylist persists for a small number of hours.</li>
                                            <li class=""p");
            WriteLiteral(@"rivacypolicyspan"">Temporary denylist of credit cards associated with denylisted IP addresses. This denylist persists for a small number of days.</li>
                                        </ul>

                                        <h3 class=""mb-2"">Selling Personal Information</h3>
                                        <p>Our doesn’t sell Personal Information</p>
                                        <h3 class=""mb-0"">
                                            Your rights
                                        </h3>
                                        <h4 class=""mb-2"">GDPR</h4>
                                        <p>If you are a resident of the EEA, you have the right to access the Personal Information we hold about you, to port it to a new service, and to ask that your Personal Information be corrected, updated, or erased. If you would like to exercise these rights, please contact us through the contact information below.</p>
                                        <h3 class=""mb-");
            WriteLiteral(@"2"">
                                            Cookies
                                        </h3>
                                        <p>
                                            A cookie is a small amount of information that’s downloaded to your computer or device when you visit our Site. We use a number of different cookies, including functional, performance, advertising, and social media or content cookies. Cookies make your browsing experience better by allowing the website to remember your actions and preferences (such as login and region selection). This means you don’t have to re-enter this information each time you return to the site or browse from one page to another. Cookies also provide information on how people use the website, for instance whether it’s their first time visiting or if they are a frequent visitor.
                                        </p><p>
                                            We use the following cookies to optimize your experience on our Site and to pr");
            WriteLiteral(@"ovide our services.
                                        </p>
                                        <h4 class=""mb-2"">Cookies Necessary for the Functioning of the Store</h4>
                                        <table class=""PrivacyTable mb-2"">
                                            <thead>
                                                <tr class=""PrivacyTableHead""><th>Name</th><th>Function</th></tr>
                                            </thead>
                                            <tbody>
