                                                    <td>Used in connection with n");
            WriteLiteral(@"avigation through a storefront.</td>
                                                </tr>
                                                <tr>
                                                    <td>cart</td>
                                                    <td>Used in connection with checkout.</td>
                                                </tr>
                                                <tr>
                                                    <td>cart_ts</td>
                                                    <td>Used in connection with checkout.</td>
                                                </tr>
                                                <tr>
                                                    <td>checkout_token</td>
                                                    <td>Used in connection with checkout.</td>
                                                </tr>
                                                <tr>
                                                ");
            WriteLiteral(@"    <td>secret</td>
                                                    <td>Used in connection with checkout.</td>
                                                </tr>
                                                <tr>
                                                    <td>secure_customer_sig</td>
                                                    <td>Used in connection with customer login.</td>
                                                </tr>
                                                <tr>
                                                    <td>storefront_digest</td>
                                                    <td>Used in connection with customer login.</td>
                                                </tr>

                                            </tbody>
                                        </table>
                                        <p class=""mb-1"">The length of time that a cookie remains on your computer or mobile device depends on whether it is a “per");
            WriteLiteral(@"sistent” or “session” cookie. Session cookies last until you stop browsing and persistent cookies last until they expire or are deleted. Most of the cookies we use are persistent and will expire between 30 minutes and two years from the date they are downloaded to your device.</p>
                                        <p class=""mb-1"">You can control and manage cookies in various ways. Please keep in mind that removing or blocking cookies can negatively impact your user experience and parts of our website may no longer be fully accessible.</p>
                                        <p class=""mb-1"">Most browsers automatically accept cookies, but you can choose whether or not to accept cookies through your browser controls, often found in your browser’s “Tools” or “Preferences” menu. For more information on how to modify your browser settings or how to block, manage or filter cookies can be found in your browser’s help file or through such sites as <a href=""www.allaboutcookies.org"">www.allaboutcookies.org.<");
            WriteLiteral(@"/a></p>
                                        <p class=""mb-1"">Additionally, please note that blocking cookies may not completely prevent how we share information with third parties such as our advertising partners. To exercise your rights or opt-out of certain uses of your information by these parties, please follow the instructions in the “Behavioural Advertising” section above.</p>
                                        <h4 class=""mb-2"">Do Not Track</h4>
                                        <p class=""mb-1"">Please note that because there is no consistent industry understanding of how to respond to “Do Not Track” signals, we do not alter our data collection and usage practices when we detect such a signal from your browser.</p>
                                        <h3 class=""mb-2"">Changes</h3>
